export default function TextForm() {
  return (
    <>
      <div className="container mt-5">
        <div className="row">
          <div className="mb-3">
            <label for="mybox" className="form-label">
              Example textarea
            </label>
            <textarea className="form-control" id="mybox" rows="3"></textarea>
          </div>
        </div>
      </div>
    </>
  );
}
